{id: 7827248062, assigner_id: null, assignee_id: null, project_id: 2205351073, section_id: null, parent_id: null, order: 886, content: YesDelft collaboration, description: Attention, Students!
Ever wondered what it is like to work for an innovative startup?
This April 4th, join the Philips Innovation Award's Find Your Talent Day, in
collaboration with YesDelft! and FSR Rotterdam. It is your chance to connect with 30
PHIA semi-finalists, all on the lookout for motivated students like you. Is there a
match? Then you might consider becoming an intern, employee or co-founder at one
of the most innovative startups in the Netherlands!
From 2:30 PM to 5:00 PM, dive into job fair rounds, meet startup founders, and
explore internship and job opportunities across various sectors - from healthcare to
technology. Moreover, prepare to be inspired as a start-up founder shares their
success story.
Location: Groothandelsgebouw Rotterdam (next to central station).
Sign up now for free via this link and kickstart your journey into the startup world!
See you there!
